import React, { useEffect } from 'react';

const DailyScorePopup = ({ dailyData }) => {
  // Log the full dailyData object to ensure it is passed correctly
  useEffect(() => {
    console.log('Props passed to DailyScorePopup:', dailyData);
  }, [dailyData]);

  // Check if dailyData and aggregated_data are present
  if (!dailyData || !dailyData.aggregated_data) {
    return <p>Loading daily data...</p>;  // Render loading state while data is being fetched
  }

  // Destructure aggregated_data and other fields from dailyData
  const {
    'Acceleration(m/s^2)': acceleration = 'N/A',
    'Braking_Intensity': brakingIntensity = 'N/A',
    'Heading_Change(degrees)': headingChange = 'N/A',
    'Jerk(m/s^3)': jerk = 'N/A',
    'SASV': sasv = 'N/A',
    'Speed(km/h)': speedKmh = 'N/A',
    'Speed_Violation': speedViolation = 'N/A',
  } = dailyData.aggregated_data;

  const drivingScore = dailyData.driving_score || 'N/A';
  const drivingCategory = dailyData.driving_category || 'N/A';
  const totalDistanceCovered = dailyData.total_distance_covered_km || 'N/A';
  const totalTrips = dailyData.total_trips || 'N/A';

  // Properly handle NaN values for jerk and other potential edge cases
  const formattedJerk = isNaN(jerk) ? 'N/A' : jerk;

  return (
    <div className="daily-score-popup">
      <h3>Daily Driving Summary</h3>
      <div className="summary-container">
        <div className="summary-item">
          <h4>Driving Score</h4>
          <p>{drivingScore} / 100</p>
        </div>
        <div className="summary-item">
          <h4>Driving Category</h4>
          <p>{drivingCategory}</p>
        </div>
        <div className="summary-item">
          <h4>Total Distance Covered</h4>
          <p>{totalDistanceCovered} km</p>
        </div>
        <div className="summary-item">
          <h4>Total Trips</h4>
          <p>{totalTrips}</p>
        </div>
        <div className="summary-item">
          <h4>Average Speed</h4>
          <p>{speedKmh} km/h</p>
        </div>
        <div className="summary-item">
          <h4>Acceleration</h4>
          <p>{acceleration} m/s²</p>
        </div>
        <div className="summary-item">
          <h4>Jerk</h4>
          <p>{formattedJerk} m/s³</p>
        </div>
        <div className="summary-item">
          <h4>Braking Intensity</h4>
          <p>{brakingIntensity}</p>
        </div>
        <div className="summary-item">
          <h4>Heading Change</h4>
          <p>{headingChange} degrees</p>
        </div>
        <div className="summary-item">
          <h4>Speed Violations</h4>
          <p>{speedViolation}</p>
        </div>
        <div className="summary-item">
          <h4>SASV (Sudden Acceleration/Speed Violation)</h4>
          <p>{sasv}</p>
        </div>
      </div>
    </div>
  );
};

export default DailyScorePopup;
